import React from "react";
import Slides from "./Slides";
import img1 from "../images/Muntele-Fuji-Japonia.jpg"
import img2 from "../images/pietre.jpg"
import img3 from "../images/sphinx-bucegi-romania.jpg"

export default function SlideShow2(){

    const images = [
        
        img1,
        img2,
        img3
    ];


    return(

        <div className="slide--show">

            <Slides images={images} />
        </div>
    )
}
